attr.attrdef:
A unique identifier for the feature geometry controlled by the user. This identifier is the primary key of the dataset for data sharing purposes. 

This should NOT be an automated Esri GlobalID attribute.

Example: {635D4DA2-181C-4ac1-9178-B40033D448ED}

